                    dp3[i][k] = max(dp2[i + 1][k], dp2[i][k], dp1[i + 1][k], 2 + dp1[i + 1][k - 1])
        dp1 = [k[:] for k in dp2]
        dp2 = [k[:] for k in dp3]
